import React, { useState, useEffect } from "react";
import { RiMenu3Line, RiCloseLine } from "react-icons/ri";
import logo from "../../assets/Untitled (4).svg";
import "./navbar.css";

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  const handleScroll = () => {
    if (window.scrollY > 0) {
      setScrolled(true);
    } else {
      setScrolled(false);
    }
  };

  useEffect(() => {
    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  return (
    <div className={`llm__navbar section__padding ${scrolled ? "scrolled" : ""}`}>
      <div className="llm__navbar-links">
        <div className="llm__navbar-links_logo">
          <a href="#home">
            <img src={logo} alt="logo" />
          </a>
        </div>
        <div className="llm__navbar-links_container">
          <p>
            <a href="#home">Home</a>
          </p>
          <p>
            <a href="#about">About</a>
          </p>
          <p>
            <a href="#features">Features</a>
          </p>
          <p>
            <a href="#pricing">Pricing</a>
          </p>
          <p>
            <a href="#contact">Contact</a>
          </p>
        </div>
        <div className="llm__navbar-sign">
        <p><a href="http://34.173.111.207/login/">Log in</a></p>
          <a href="http://34.173.111.207/register/form">
          <button  type="button">Create Free</button>
            </a>
        </div>
      </div>
      <div className="llm__navbar-menu">
        {toggleMenu ? (
          <RiCloseLine
            color="#000000"
            size={30}
            onClick={() => setToggleMenu(false)}
          />
        ) : (
          <RiMenu3Line
            color="#000000"
            size={30}
            onClick={() => setToggleMenu(true)}
          />
        )}
        {toggleMenu && (
          <div className="llm__navbar-menu_container scale-up-center">
            <div className="llm__navbar-menu_container-links">
              <p>
                <a href="#home">Home</a>
              </p>
              <p>
                <a href="#about">About</a>
              </p>
              <p>
                <a href="#features">Features</a>
              </p>
              <p>
                <a href="#pricing">Pricing</a>
              </p>
              <p>
                <a href="#contact">Contact</a>
              </p>
            </div>
            <div className="llm__navbar-menu_container-links-sign">
            <p><a href="http://34.173.111.207/login/">Log in</a></p>
          <a href="http://34.173.111.207/register/form">
          <button  type="button">Create Free</button>
            </a>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Navbar;
